import React from 'react'
import { LogMessageType } from '../../../_enums/LogmessageType'
import { ILogmessage } from './interfaces/ILogmessage'
import LoggingPageContainer from './loggingPageContainer'

interface IProps{

}

const LoggingDataservice: React.FC<IProps> = (props) =>{
    
    const [selectedItems, setSelectedItems] = React.useState<number[]>([])

    const handleSelectedItemsChanged = React.useCallback((items: number[]) =>{
        setSelectedItems(items)
    },[])

    const logmessages = React.useMemo((): ILogmessage[] =>{
        return[
            {id: 1, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 1', exception:""},
            {id: 2, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 2', exception:""},
            {id: 3, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 3', exception:""},
            {id: 4, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 4', exception:""},
            {id: 5, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 5', exception:""},
            {id: 6, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 6', exception:""},
            {id: 7, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 7', exception:""},
            {id: 8, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 8', exception:""},
            {id: 9, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 1', exception:""},
            {id: 10, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 2', exception:""},
            {id: 11, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 3', exception:""},
            {id: 12, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 4', exception:""},
            {id: 13, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 5', exception:""},
            {id: 14, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 6', exception:""},
            {id: 15, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 7', exception:""},
            {id: 16, date: new Date(), logMessageType: LogMessageType.Error, message: 'Any Error - 8', exception:""}
        ]
    },[])

    return(
        <LoggingPageContainer
            logmessages={logmessages}/>
    )
}

export default LoggingDataservice
